import React, { Component } from "react";

export default class Board extends Component {
  render() {
    let cell = "";
    const puzzle = [
      [cell, cell, cell, cell, cell, cell, cell, cell, cell],
      [cell, cell, cell, cell, cell, cell, cell, cell, cell],
      [cell, cell, cell, cell, cell, cell, cell, cell, cell],
      [cell, cell, cell, cell, cell, cell, cell, cell, cell],
    ];

    return (
      <div>
        <table className="sudoku-table">
          <tbody>
            {puzzle.map(function (line, i) {
              return (
                <tr key={i}>
                  {line.map(function () {
                    return cell;
                  })}
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    );
  }
}
